import React, { useState } from 'react'
import './Homepagehover.css'
function Homepagehover() {
    const[data,setData]=useState([{
        id:0,content:"Choose your Local Targetting",status:false
    },{
        id:1,content:"Track your Conversion",status:false
    },{
        id:2,content:"Customized Campaigns",status:false
    },{
        id:3,content:"Get dedicated support team ",status:false
    },{
        id:4,content:"Quality Assurance",status:false
    }])
  return (
    <div>
       <div className="hover">
          <div className="Hovercontent">
              <div className="content">
                 {data && data.map(el=>(
                    <div className='elements'>
                        <h4>{el.content}</h4>
                        </div>
                 ))}
              </div>
          </div>
       </div>
    </div>
  )
}

export default Homepagehover
